import React from 'react';
import OperationForm from './components/OperationForm';

function App() {
  return (
      <div className="App">
          <header>
              <img src="score_vsp_logo.png" alt="Header Image" className="header-image"/>
          </header>
          <OperationForm/>
      </div>
  );
}

export default App;
